								delay: 0.25,
								x: 0,
								y: 0,
								overwrite: "none",

						} else {

								delay: 0.0,
								x: 0,
								y: 0,
								overwrite: "none",
								ease: Sine.easeOut,

					if (cell === 0) {
						gsap.to(appMc[`mcTnt${cell}`].scale, 0.5, {
							delay: 0.1,
							overwrite: "none",
							x: 0.2,
							y: 0.2,
							yoyo: true,
							repeat: -1,
							ease: Sine.easeInOut,
						});
					} else {
						gsap.to(appMc[`mcTnt${cell}`].scale, 0.5, {
							delay: 0.1,
							overwrite: "none",
							x: 0.2,
							y: 0.2,
							yoyo: true,
							repeat: -1,
							ease: Sine.easeInOut,
						});
					}

					appMc[`mcTnt${cell}`].interactive = true;
					appMc[`mcTnt${cell}`].on("pointerdown", () => onClickCell(cell));
				}

						overwrite: "none",

						x: 0,

						ease: Back.easeIn,

					appSounds[`sound-${cell}`].play();

					setTimeout(() => {
						gsap
							.timeline()
							.to(appMc.mcBlowTntBtn, 0.3, {
								delay: 0.2,
								overwrite: "none",
								alpha: 0,
								ease: Sine.easeOut,
								onComplete: () => changeBg(cell),
							})
							.to(appMc.mcPickTnt.scale, 0.5, {
								overwrite: "none",
								delay: 0.2,
								x: 1,
								y: 1,
								ease: Back.easeOut,
							});
					}, 800);
				}

				// function to change active item
				function changeBg(current) {
					const next = current + 1;
					appMc[`mcBox${current}`].visible = true;
					appMc[`mcBoxActive${current}`].visible = false;

					appMc[`mcBox${next}`].visible = false;
					appMc[`mcBoxActive${next}`].visible = true;

					animateCell(next);
					console.log(next);
				}

				// Blow btn animation
				function blowBtnAnimation() {
					gsap
						.timeline()
						.set(appMc.mcBlowTntBtn, {
							visible: true,
							alpha: 1,
						})
						.from(appMc.mcBlowTntBtn.scale, 0.5, {
							overwrite: "none",
							x: 0,
							y: 0,
							ease: Back.easeOut,
						});
					// .to(appMc.mcBlowTntBtn.scale, 0.5, {
					// 	overwrite: "none",
					// 	x: "-=.07",
					// 	y: "-=.07",
					// 	yoyo: true,
					// 	repeat: -1,
					// 	ease: Sine.easeInOut,
					// });
				}

				// Sequences animations
				function sequenceAnimation(seq) {
					gsap
						.timeline()
						.set(appMc[`mcSequence${seq}`], {
							visible: true,
						})
						.from(appMc[`mcSequence${seq}`], 0.9, {
							overwrite: "none",
							delay: 0.1,
							x: 0,
							y: -500,
							alpha: 0,
							ease: Bounce.easeOut,
							onComplete: blowTnt(seq),
						});
				}

				// Pick tnt sprite
				appMc.mcPickTnt = new createSprite({
					p: appMc.mcMainContainer,
					tex: "pick-tnt-text",
				});

				//- mcBgOverlay
				appMc.mcBgOverlay = new createRect({
					p: appMc.mcUI,
					x: -1280 * 0.5,
					y: -1280 * 0.5,
					width: 1280,
					height: 1280,
					color: 0x000000,
					alpha: 0.0,
					fill: 1,
					radius: 0,
				});

				//- mcBgFS
				appMc.mcBgFS = new createRect({
					p: appMc.mcUI,
					x: -1280 * 0.5,
					y: -1280 * 0.5,
					width: 1280,
					height: 1280,
					color: 0x121214,
					alpha: 0,
					visible: false,
				});

				// appMc.mcBgOverlay.interactive = true;
				// appMc.mcBgOverlay.on("pointerdown", StageDown);
				// appMc.mcBgOverlay.on("pointermove", StageMove);
				// appMc.mcBgOverlay.on("pointerup", StageUp);
				// appMc.mcBgFS.interactive = true;
				// appMc.mcBgFS.on("pointerup", ClickAd);

				//- mcBtnSound
				appMc.mcBtnSound = new createContainer({ p: appMc.mcUI });
				appMc.mcBtnSoundB = new createSprite({
					p: appMc.mcBtnSound,
					tex: "btn_sound_off",
				});

				appMc.mcBtnSound.interactive = true;
				appMc.mcBtnSound.on("pointerup", BtnGlobalSound);
			};

			// Init animation
			const InitAnimation = () => {
				let i, objTemp;
				appMc.mcMain.visible = true;
				document.getElementById("main").style.visibility = "visible";
				document.getElementById("progress").style.display = "none";
				//	appSounds["bg"].play();
				stateGame = 0;
			};
			// Events
			const EndGame = () => {
				let i, objTemp;
				if (stateGame != 10) {
					stateGame = 10;

					appMc.mcBgFS.visible = true;
				}
			};
			const StageDown = (e) => {
				if (stateGame == 0) {
					stateGame = 1;
					if (!isGlobalActive) {
						isGlobalActive = true;
						isGlobalSound = true;
						Howler.mute(!isGlobalSound);
					}
				}
				mouse.isDown = true;
			};
			const StageMove = (e) => {
				if (mouse.isDown) {
					mouse.x = e.data.getLocalPosition(appMc.mcWorldCamera).x;
					mouse.y = e.data.getLocalPosition(appMc.mcWorldCamera).y;
				}
			};
			const StageUp = (e) => {
				mouse.isDown = false;

				//	appMc.mcConfetti = new Confetti({p:appMc.mcUI, count:100});

				// appMc.mcSparkle = new itemSparkle({
				// 	p: appMc.mcUI,
				// 	tex: "flare",
				// 	count: 100,
				// 	t: 10,
				// 	dx: 15,
				// 	dy: 15,
				// 	s: 0.5,
				// });
			};
			const BtnGlobalSound = (e) => {
				if (isGlobalSound) {
					isGlobalSound = false;

					appMc.mcBtnSoundB.texture =
						moduleTexture.pixiTextures["btn_sound_off"];

					Howler.mute(true);
				} else {
					isGlobalSound = true;

					appMc.mcBtnSoundB.texture =
						moduleTexture.pixiTextures["btn_sound_on"];

					Howler.mute(false);
				}
			};
			// StageEF
			const StageEF = () => {
				appObj.time_current = performance.now();
				if (appObj.time_current - appObj.time_old > 25) {
					appObj.time_old = appObj.time_current;
					// 33 - 30 fps
					// 16 - 60 fps

					let i, j, k;
					let objTemp;
					let objTempExtra;

					//- Camera

					if (appMc.mcWorldShake.shakeD != 0) {
						appMc.mcWorldShake.shakeAX += 70;
						appMc.mcWorldShake.shakeAY += 90;
						if (appMc.mcWorldShake.shakeAX >= 360) {
							appMc.mcWorldShake.shakeAX -= 360;
						}
						if (appMc.mcWorldShake.shakeAY >= 360) {
							appMc.mcWorldShake.shakeAY -= 360;
						}
						appMc.mcWorldShake.x =
							appMc.mcWorldShake.shakeD *
							Math.cos(appMc.mcWorldShake.shakeAX * toRAD);
						appMc.mcWorldShake.y =
							appMc.mcWorldShake.shakeD *
							Math.cos(appMc.mcWorldShake.shakeAY * toRAD);
						appMc.mcWorldShake.shakeD *= 0.85;
						if (appMc.mcWorldShake.shakeD < 0.5) {
							appMc.mcWorldShake.shakeD = 0;
							appMc.mcWorldShake.x = 0;
							appMc.mcWorldShake.y = 0;
						}
					}
					appObj.updateSeq0 && appMc.mcSequence0.update();
					appObj.updateSeq1 && appMc.mcSequence1.update();
					appObj.updateSeq2 && appMc.mcSequence2.update();

					tmDebug++;
					if (tmDebug == 100) {
						tmDebug = 0;
					}

					//- PIXI RENDER

					renderer.render(stage);

					//- P2 World
					if (physics) {
						appMc.p2world.step(1 / 60);
					}

					//- P2 World

					//- RESIZE

					objTemp = appObj;
					objTemp.tm_resize++;
					if (objTemp.tm_resize == 10) {
						objTemp.tm_resize = 0;

						if (
							objTemp.mainWidth != Math.ceil(window.innerWidth) ||
							objTemp.mainHeight != Math.ceil(window.innerHeight)
						) {
							AppResize();
						}
					}
				}

				//- RAF
				window.requestAnimationFrame(StageEF);
			};

			//- Resize
			const AppResize = (e) => {
				appObj.mainWidth = Math.ceil(window.innerWidth);
				appObj.mainHeight = Math.ceil(window.innerHeight);
				appObj.canvasWidth = Math.ceil(1.4 * window.innerWidth);
				appObj.canvasHeight = Math.ceil(1.4 * window.innerHeight);

				renderer.view.style.width = appObj.mainWidth + "px";
				renderer.view.style.height = appObj.mainHeight + "px";
				renderer.view.width = appObj.canvasWidth;
				renderer.view.height = appObj.canvasHeight;

				renderer.resize(appObj.canvasWidth, appObj.canvasHeight);

				stage.position.set(
					Math.ceil(appObj.canvasWidth * 0.5),
					Math.ceil(appObj.canvasHeight * 0.5)
				);
				//- POSITION OBJ
				appMc.mcGame.scale.set(1, 1);
				appMc.mcUI.scale.set(1, 1);

				if (appObj.mainWidth < appObj.mainHeight) {
					appMc.mcGame.scale.x = appObj.canvasWidth / 1280;
					appMc.mcGame.scale.y = appMc.mcGame.scale.x;
					if (appMc.mcGame.scale.y * 1280 < appObj.canvasHeight) {
						appMc.mcGame.scale.y = appObj.canvasHeight / 1280;
						appMc.mcGame.scale.x = appMc.mcGame.scale.y;
					}

					appMc.mcUI.scale.x = appObj.canvasWidth / 720;
					appMc.mcUI.scale.y = appMc.mcUI.scale.x;
					if (appMc.mcUI.scale.y * 1280 > appObj.canvasHeight) {
						appMc.mcUI.scale.y = appObj.canvasHeight / 1280;
						appMc.mcUI.scale.x = appMc.mcUI.scale.y;
					}

					appMc.mcBgFS.scale.x =
						0.1 + appObj.canvasWidth / 1280 / appMc.mcUI.scale.x;
					appMc.mcBgFS.scale.y =
						0.1 + appObj.canvasHeight / 1280 / appMc.mcUI.scale.x;

					appMc.mcBgOverlay.scale.x =
						0.1 + appObj.canvasWidth / 1280 / appMc.mcUI.scale.x;
					appMc.mcBgOverlay.scale.y =
						0.1 + appObj.canvasHeight / 1280 / appMc.mcUI.scale.x;

					appMc.mcBtnSound.x =
						-60 + (appObj.canvasWidth * 0.5) / appMc.mcUI.scale.y;
					appMc.mcBtnSound.y =
						-55 + (appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y;
					appMc.mcBtnSound.scale.set(0.65);

					appMc.mcTopHearts.y =
						((-appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y) * 0.9;
					appMc.mcTopHearts.scale.set(1);

					appMc.mcTntContainers.y =
						-130 + (appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y;

					appMc.mcTntContainers.scale.set(0.7);

					appMc.mcPickTnt.y =
						-(appObj.canvasHeight * 0.5 * 0.65) / appMc.mcUI.scale.y;

					appMc.mcGun.scale.set(0.9);
					appMc.mcBlowTntBtn.scale.set(1);

					appMc.mcBlowTntBtn.y = -130;
				} else {
					appMc.mcGame.scale.x = appObj.canvasWidth / 1280;
					appMc.mcGame.scale.y = appMc.mcGame.scale.x;
					if (appMc.mcGame.scale.y * 1280 < appObj.canvasHeight) {
						appMc.mcGame.scale.y = appObj.canvasHeight / 1280;
						appMc.mcGame.scale.x = appMc.mcGame.scale.y;
					}

					appMc.mcUI.scale.x = appObj.canvasWidth / 1280;
					appMc.mcUI.scale.y = appMc.mcUI.scale.x;
					if (appMc.mcUI.scale.y * 720 > appObj.canvasHeight) {
						appMc.mcUI.scale.y = appObj.canvasHeight / 720;
						appMc.mcUI.scale.x = appMc.mcUI.scale.y;
					}

					appMc.mcBgFS.scale.x =
						0.1 + appObj.canvasWidth / 1280 / appMc.mcUI.scale.x;
					appMc.mcBgFS.scale.y =
						0.1 + appObj.canvasHeight / 1280 / appMc.mcUI.scale.x;

					appMc.mcBgOverlay.scale.x =
						0.1 + appObj.canvasWidth / 1280 / appMc.mcUI.scale.x;
					appMc.mcBgOverlay.scale.y =
						0.1 + appObj.canvasHeight / 1280 / appMc.mcUI.scale.x;

					appMc.mcBtnSound.x =
						-60 + (appObj.canvasWidth * 0.5) / appMc.mcUI.scale.y;
					appMc.mcBtnSound.y =
						-60 + (appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y;
					appMc.mcBtnSound.scale.set(0.65);

					appMc.mcTopHearts.y =
						((-appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y) * 0.85;

					appMc.mcTopHearts.scale.set(1.4);

					appMc.mcTntContainers.scale.set(1);

					appMc.mcTntContainers.y =
						-90 + (appObj.canvasHeight * 0.5) / appMc.mcUI.scale.y;

					appMc.mcPickTnt.y =
						-(appObj.canvasHeight * 0.5 * 0.58) / appMc.mcUI.scale.y;

					appMc.mcGun.scale.set(0.7);

					appMc.mcBlowTntBtn.scale.set(0.7);

					appMc.mcBlowTntBtn.y = -100;
				}
			};
			// Resize
		</script>
	</body>
</html>
